pragma solidity ^0.5.11;

import "../all-signature/AllSignature.sol";

contract MultipleSignature is AllSignature {

  /// @notice Creates All Signature Document and store contract's address in mapping
  /// @dev Invoked by uploader using metamask
  /// @param _uploader Address of creator of All Signature Contract.
  /// @param _eternalStorage Address of eternal storage for metric logging.
  /// @param _documentHash Hash of uploaded document within 32 bytes.
  /// @param _signersAddresses Array of addresses. Ensure index of address corresponds to index of signersEmails
  /// @param _signersEmails Array of 32 bytes hash of emails of signatories.
  /// @param _date Unix timestamp of when the contract is created
  /// @param _signaturesNeeded number of signatures necessary for document to be valid.
  /// @param  _fileName Description/Name of file.
  constructor(
    address _uploader,
    address _eternalStorage,
    bytes32 _documentHash,
    address[] memory _signersAddresses,
    bytes32[] memory _signersEmails,
    uint256 _date,
    uint256 _signaturesNeeded,
    string memory _fileName
  )
    public
    AllSignature(
      _uploader,
      _eternalStorage,
      _documentHash,
      _signersAddresses,
      _signersEmails,
      _date,
      _fileName
    )
  {
    //multisig type: 2
    docInfo.contractType = 2;
    docInfo.signaturesNeeded = _signaturesNeeded;
  }

  /// @notice Store signature in contract. Function is inherited as the contract type and key for metric
  /// logging, MULTISIG_SIGNATURES_COUNT, differs from that of the AllSignature contract.
  /// @dev Invoked by signatory, only possible if signer is a valid signatory.
  /// @param _signature signed hash of the document. Type: String.
  /// @param _dochash hash of document to 32 bytes.
  /// @return boolean value if signing was successful + emit event.
  function signDocument(string calldata _signature, bytes32 _dochash)
    external
    isValidSigner(msg.sender)
    notYetSigned(msg.sender)
    returns (bool)
  {
    require(
      keccak256(abi.encodePacked((docInfo.documentHash))) ==
        keccak256(abi.encodePacked((_dochash))),
      "Incorrect document hash"
    );
    signersMap[msg.sender].signature = _signature;
    docInfo.signedCount++;
    emit SigningEvent(msg.sender, address(this), _dochash, 2, true);
    es.incrementMetrics("MULTISIG_SIGNATURES_COUNT");

    return true;
  }
}

